insert into `rep_reportinfo` (`REPORTID`, `TITLE`, `DECLAREDATE`, `REPORTDATE`, `SUMMARY`, `KEYWORDS`, `FILESTORAGEPATH`, `FILETYPE`, `FILESIZE`, `UPDATEID`, `UPDATESTATE`, `UPDATETIME`, `BUSINESSTIME`, `UTSID`) values('101061','证券-A股市场投资研究周报-120213','2012-02-14 09:38:52','2012-02-13 00:00:00','\"\"策略要点：','\"\"策略要点：','\\研报正文\\投资策略(投资、策略)\\2012\\2012-02\\2012-02-14\\','PDF','1169','101062','0','2012-10-11 10:20:10','2012-09-11 15:55:46','34');
insert into `rep_reportinfo` (`REPORTID`, `TITLE`, `DECLAREDATE`, `REPORTDATE`, `SUMMARY`, `KEYWORDS`, `FILESTORAGEPATH`, `FILETYPE`, `FILESIZE`, `UPDATEID`, `UPDATESTATE`, `UPDATETIME`, `BUSINESSTIME`, `UTSID`) values('117241','中投证券-策略周报：“买结构“行情蓄势,“买指数“或也不远-120528','2012-05-29 09:33:45','2012-05-28 00:00:00','\"投资要点： \n   上周市场小幅下跌，仍有一些板块录得正涨幅，如我们建议配置的房地产、机械等行业涨幅靠前；当前是政策\"加力\"背景下的\"买结构\"行情。www.microbell.com【迈博汇金】对于未来一段时间，市场焦点仍在欧债事件的进展以及政策可持续性。www.microbell.cn（迈博汇金）\n   需动态关注希腊政党民调支持率及银行危机进展。1、最新五项民调显示新民主党的选民支持率再度确立优势，希腊人民开始理性逐步认识退欧后果。2、由于希腊挤提现象严重，虽然希腊银行已经获得部分紧急援助，但这一风险的传导在加快，特别是西班牙银行受到牵连，近期接连下调评级，增加欧洲银行危机进一步升级可能。欧央行阶段性\"紧急流动性救援\"、德国是否能够妥协将是重要的观察点。  \n    国内稳增长与结构转型双管齐下。对比前后三次的温总理与李副总理谈话来看，各自有侧重点：温总理更加强调当前加大预调微调，李副总理更加强调长效机制；温总理着力从刺激消费、减税、财政补贴等方式扩大内需，李副总理强带转型升级是扩大内需有效途径；温总理部署尽快启动重大项目，李副总理强调市场\"倒逼\"机制。两人分别强调当前和着眼未来，但可以看出未来政策思路：当前可能以项目启动以及刺激消费等方式平滑经济过快回落为主，但中长期政策试探性释放制度红利以调结构和促转型为主。 \n    \"项目包\"呈现加速现象。1、预计铁路、机场、市政、能源、电信、医疗、教育等是审批重点。在近期重大项目审批方面，推进钢铁产业结构调整和发展方式转变，加速机场建设。2、目前发改委\"门庭若市\"或是进一步加速新项目审批的前导指标，在国家加速审批项目同时，以广东为代表的各地加快本地区重大建设项目工作力度，后期有望得到发改委择优核准。\"',NULL,'\\研报正文\\股票池(组合、股票池、策略、配置、精选)\\2012\\2012-05\\2012-05-29\\','PDF','1387','117242','0','2012-10-11 10:20:10','2012-09-10 14:17:20','31');
insert into `rep_reportinfo` (`REPORTID`, `TITLE`, `DECLAREDATE`, `REPORTDATE`, `SUMMARY`, `KEYWORDS`, `FILESTORAGEPATH`, `FILETYPE`, `FILESIZE`, `UPDATEID`, `UPDATESTATE`, `UPDATETIME`, `BUSINESSTIME`, `UTSID`) values('113111','中投证券-策略周报：静待欧债情绪缓和时点-120520','2012-05-21 15:03:07','2012-05-20 00:00:00','\"投资要点：\n. 上周市场虽有调准及“政策包”部分政策利好，但A股仍受累于欧债忧虑升级引发的避险情绪陡增，上周上证指数下跌2.11%，表现弱于我们预期。www.microbell.com【迈博汇金】\n. 静待欧债情绪缓和时点。www.microbell.cn（迈博汇金）基于希腊退出欧元区“多输”的结局，我们预计欧债问题对投资者有一剑封喉之忧，料无之实。未来糟糕的现实可能会倒逼妥协，逐步形成趋向缓和的情绪拐点。但在6月17日希腊二次大选前，希腊将处于无政府状态，期间包括挤提、评级调降、金援断供、国债收益率飙升、欧债国家受牵连等可能的事件仍有阶段压制全球市场情绪可能。\n. 我们认为针对当前经济弱项，对冲的“政策包”按钮已经启动，是对温家宝总理提出的“把稳增长放在更加重要位置”的直接诠释。1、降准降低资金成本；2、对家电、节能灯及LED、节能汽车补贴，专家预计三项补贴或拉动约4500亿元消费需求；3、国土部通知提高建设用地审批效率；4、拟定扩大消费需求指导意见，拟定营业税改增值税试点范围。5、铁路全面向民间引资。从铁路行业自身来看，全面引入民间资本，主要是解决资金问题。由于其绵长的产业链条，对整个经济的拉动作用较为全面。铁路在其大周期建设中，产业链涉及到多个领域，铁路建筑行业、工程机械、铁路车辆、铁路建材（水泥，钢铁）电气设备、以及沿线地产等等均会有不同程度受益，结合铁路建设的进程，我们认为行业受益的前后顺序有可能依次为建材、机械、电气设备、铁路车辆。6、另外，未来事关全局、带动性强“项目包”仍值得期待。\"',NULL,'\\研报正文\\股票池(组合、股票池、策略、配置、精选)\\2012\\2012-05\\2012-05-21\\','PDF','1258','113112','1','2012-10-11 10:20:10','2012-09-10 14:20:59','32');
insert into `rep_reportinfo` (`REPORTID`, `TITLE`, `DECLAREDATE`, `REPORTDATE`, `SUMMARY`, `KEYWORDS`, `FILESTORAGEPATH`, `FILETYPE`, `FILESIZE`, `UPDATEID`, `UPDATESTATE`, `UPDATETIME`, `BUSINESSTIME`, `UTSID`) values('59521','东兴证券-A股市场投资研究周报-120213','2012-02-14 09:38:52','2012-02-13 00:00:00','\"策略要点：\n在短期市场无需担忧流动性的背景下，流动性的回暖产生的估值修复，促发市场反弹是必然的结果，但反弹到一定高度能否继续上行还亟需寻找新的上涨动力，这必然会涉及到经济的基本面上来。从下游可选消费品的相关指标来看，经济底的确认还言之尚早。既然经济底的确认过早，那就要看相关政策。“双稳”政策基调决定政策放松不会一蹴而就。芜湖房地产新政颁布几天之后在上周日被紧急叫停，从市场的层面上，芜湖新政的叫停短期将对股指形成抑制。\n我们预计，本周股指或将出现震荡，但下行空间非常有限，稳增长的基调决定市场向上的趋势不改。这一阶段的投资择时和行业配臵尤为重要。在行业配臵上，我们遵循以下几条线索：一是人民币升值预期的造纸、航空等行业；二是资源价格改革受益的基础能源和新能源等相关行业；三是落实非公36条背景下的铁路、金融等相关行业。\"',NULL,'\\研报正文\\投资策略(投资、策略)\\2012\\2012-02\\2012-02-14\\','PDF','1169','59522','1','2012-10-11 10:20:10','2012-09-10 14:24:06','33');
insert into `rep_reportinfo` (`REPORTID`, `TITLE`, `DECLAREDATE`, `REPORTDATE`, `SUMMARY`, `KEYWORDS`, `FILESTORAGEPATH`, `FILETYPE`, `FILESIZE`, `UPDATEID`, `UPDATESTATE`, `UPDATETIME`, `BUSINESSTIME`, `UTSID`) values('38215','中投证券-策略月报：市场短期或有反弹，弱势尚未本质改变-120104','2012-01-10 08:42:24','2012-01-04 00:00:00','\"投资要点：\n    上周沪深两市持续下行，特别是创业板和中小板大幅下挫，虽然权重板块对主板指数形成了一定的支撑，市场信心依然低迷。www.microbell.com【迈博汇金】从周末公布的金融数据看，新增贷款12月6405亿、全年7.47万亿超预期，M1、M2数据出现短期企稳反弹，分别比11月回升0.1%、0.9%；银行间市场利率小幅回落，实体资金需求下滑及政策微调作用下资金供需弱平衡在逐步形成。www.microbell.cn（迈博汇金）是否“资金成本下降，股市即见底”?对此我们持谨慎态度。\n    历史上7天回购利率变化与股市见底的关系。从历史上05年、08年两次大底形成看，05年股市见底是在7天回购利率处于底部水平一段时间之后才发生，而08年股市见底与7天回购利率见底几乎同时。05年回购利率见底与当年外汇占款大幅度扩展有关，08年回购利率见底源于连续大幅度降准政策。\n    今年7天回购利率加速回落关键在货币政策。当前7天回购利率处于历史中等水平，并非底部，较低的外汇占款可能持续，因此当前回购利率水平走势着重是看货币政策时点及力度（特别是超力度预期的调准政策），可能导致资金成本快速回落，也可能催生市场底部。而在超预期政策到来之前，市场将反复筑底。\n    “经济不坏、实质政策不来”。从最近管理层推出的政策和相关信息来看，工业增加值、社会消费品零售总额的增速目标与近两年的实际增速均有所调低，铁路、保障房建设的投资力度不及预期，管理层对经济下滑的容忍度增强，而PMI数据则显示出经济下滑的势头有所缓和，短期内经济大幅下行的力度不会太大。对于即将公布的12月份经济数据，我们判断经济会维持缓落的态势，不会出现剧烈下滑。在此判断的基础上，我们认为政策加力的时点将会延后，“经济不坏、实质政策不来”，经济磨底可能会带来市场反复弱势筑底的窘境。\n    金融工作会议明确资本市场政策方向。温总理在金融工作会议上要求提振股市信心，也提出了中期具体政策方向，“深化新股发行制度市场化改革，抓紧完善发行、退市和分红制度”；我们认为信心提振的关键在于金融工作会议所列的多项中长期改革措施的落实情况\n    市场走势与配臵建议。鉴于温家宝总理要求提振股市信心及金融数据超预期等利好因素，短期市场或有小幅反弹，但我们认为市场弱势尚未本质改变。我们延续1月月报的配臵逻辑，以权重相对收益为主，题材配臵为辅。关注金融板块及一线地产股的相对收益，关注受益于节假日因素的餐饮旅游、交通运输、家用电器，关注伊朗局势对石化及能源类股的影响及投资机会，关注三产消费等待调整后的配臵机会。\n    风险提示：经济超预期下滑，政策超预期\n\"',NULL,'\\研报正文\\股票池(组合、股票池、策略、配置、精选)\\2012\\2012-01\\2012-01-10\\','PDF','1028','38216','0','2012-10-11 10:20:10','2012-09-10 13:08:13','30');
