USE qic_db;

DROP TABLE IF EXISTS `STP_StockPool`;

CREATE TABLE STP_StockPool(
	StockPoolCode BIGINT NOT NULL AUTO_INCREMENT  COMMENT '股票池编码',
	StockPoolName VARCHAR(200) COMMENT '股票池名称',
	StartDate DATETIME COMMENT '设立时间',
	EndDate   DATETIME COMMENT '终止日期',
	Strategy  VARCHAR(2000) COMMENT '选股策略',
	Description VARCHAR(2000) COMMENT '股票池简介',
	UpdateFrequency VARCHAR(6) COMMENT '更新频率',
	StockNum INT COMMENT '组合股票数',
	PRIMARY KEY(StockPoolCode)
)COMMENT='股票池基本信息' ENGINE=INNODB DEFAULT CHARSET=utf8 ;

DROP TABLE IF EXISTS `STP_Style`;

CREATE TABLE STP_Style(
	StockPoolCode BIGINT NOT NULL COMMENT '股票池编码',
	StockPoolName VARCHAR(200) COMMENT '股票池名称',
	StrategyCode  VARCHAR(20) NOT NULL COMMENT '股票池分类编码 参考STP_Parameters表的StrategyCode字段',
	StrategyName  VARCHAR(500) COMMENT '股票池分类名称',
	PRIMARY KEY(StockPoolCode, StrategyCode)
)COMMENT='股票池策略分类表' ENGINE=INNODB DEFAULT CHARSET=utf8 ;

DROP TABLE IF EXISTS `STP_Parameters`;

CREATE TABLE STP_Parameters(
	UpperStrategyCode VARCHAR(20),
	StrategyName      VARCHAR(100),
	StrategyCode      VARCHAR(20) NOT NULL,
	PRIMARY KEY(StrategyCode)
)COMMENT='股票池分类参数表' ENGINE=INNODB DEFAULT CHARSET=utf8 ;

DROP TABLE IF EXISTS `STP_Sample`;

CREATE TABLE STP_Sample(
	StockPoolCode BIGINT NOT NULL,
	StockPoolName VARCHAR(200),
	SecurityID VARCHAR(20) NOT NULL,
	Symbol VARCHAR(20),
	SecurityTypeCode VARCHAR(6),
	SecurityType VARCHAR(50),
	AdjustDate  DATETIME,
	ReportID    BIGINT,
	AdjustTypeCode VARCHAR(6),
	AdjustType  VARCHAR(50),
	AdjustReason VARCHAR(2000),
	Weight       NUMERIC(7,4),
	PRIMARY KEY(StockPoolCode,SecurityID)
)COMMENT='股票池样本信息' ENGINE=INNODB DEFAULT CHARSET=utf8 ;

DROP TABLE IF EXISTS `STP_DailyReturn`;

CREATE TABLE STP_DailyReturn(
	StockPoolCode BIGINT NOT NULL,
	TradingDate           DATETIME  NOT NULL,
	ReturnDaily           NUMERIC(8,4),
	ReturnWeekly          NUMERIC(8,4),
	ReturnCurrentWeek     NUMERIC(8,4),
	ReturnMonthly         NUMERIC(8,4),
	ReturnCurrentMonth    NUMERIC(8,4),
	Return3Month          NUMERIC(8,4),
	ReturnCurrentQuarter  NUMERIC(8,4),
	Return6Month          NUMERIC(8,4),
	ReturnCurrent6Month   NUMERIC(8,4),
	YearRTD               NUMERIC(8,4),
	ReturnAnnual          NUMERIC(8,4),
	Return2YearAnnualized NUMERIC(8,4),
	Return3YearAnnualized NUMERIC(8,4),
	Return5YearAnnualized NUMERIC(8,4),
	ReturnTotal           NUMERIC(8,4),
	AnnualizedYield       NUMERIC(8,4),
	YearSharpeRatio       NUMERIC(8,4),
	YearTreynorRatio      NUMERIC(8,4),
	YearJensenRatio       NUMERIC(8,4),
	PRIMARY KEY(StockPoolCode,TradingDate)
)COMMENT='股票池回报率' ENGINE=INNODB DEFAULT CHARSET=utf8 ;

