DROP TABLE IF EXISTS `rep_institution`;

CREATE TABLE `rep_institution` (
  `REPORTID` bigint(20) DEFAULT NULL COMMENT '研究报告编码',
  `INSTITUTIONID` varchar(40) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '发布机构ID',
  `INSTITUTIONNAME` varchar(400) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '发布机构名称',
  `UPDATEID` bigint(20) DEFAULT NULL COMMENT '数据ID',
  `UPDATESTATE` smallint(6) DEFAULT NULL COMMENT 'Update状态',
  `UPDATETIME` datetime DEFAULT NULL COMMENT 'Update时间',
  `BUSINESSTIME` datetime DEFAULT NULL COMMENT '通讯组件专用字段',
  `UTSID` bigint(20) DEFAULT NULL COMMENT 'UTS专用字段',
  KEY `IUM45735874` (`UTSID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


